DROP TABLE IF EXISTS `ODH_CODE_MANAGE`;
-- CREATE TABLE
CREATE TABLE `office`.`ODH_CODE_MANAGE` (
      REC_NO                        INT                 NOT NULL                          COMMENT '记录番号',
      ATTRIB_ID                     VARCHAR(20)             NULL                          COMMENT '属性ID',
      ATTRIB_NAME                   VARCHAR(20)             NULL                          COMMENT '属性名称',
      ATTRIB_VAL                    VARCHAR(5)              NULL                          COMMENT '属性值',
      ATTRIB_EXPLA                  VARCHAR(50)             NULL                          COMMENT '属性说明',
      ATTRIB_VAL2                   VARCHAR(5)              NULL                          COMMENT '属性值2',
      ATTRIB_EXPLA2                 VARCHAR(50)             NULL                          COMMENT '属性说明2',
      ATTRIB_VAL3                   VARCHAR(6)              NULL                          COMMENT '属性值3',
      ATTRIB_EXPLA3                 VARCHAR(50)             NULL                          COMMENT '属性说明3',
      ATTRIB_EXPLA_SHORT            VARCHAR(50)             NULL                          COMMENT '属性说明简称',
      LOGIN_NO                      CHAR(5)                 NULL                          COMMENT '登陆者工号',
      LOGIN_IP                      VARCHAR(20)             NULL                          COMMENT '登陆者IP',
      REC_INSERT_TIME               DATETIME                NULL                          COMMENT '记录作成时间',
      DELETE_STATE                  CHAR(1)                 NULL                          COMMENT '删除状态位',
      UPDATE_NO                     CHAR(5)                 NULL                          COMMENT '更新者工号',
      UPDATE_IP                     VARCHAR(20)             NULL                          COMMENT '更新者IP',
      REC_UPDATE_TIME               DATETIME                NULL                          COMMENT '记录更新时间',
      PRIMARY KEY ( `REC_NO`)
)
ENGINE=InnoDB DEFAULT CHARACTER SET = utf8;
ALTER TABLE `office`.`ODH_CODE_MANAGE`
COMMENT = '代码名称管理表';

